import React from "react";

class Home extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      date: new Date(),
      company: "",
      code: "",
    };
    this.handleChange = this.handleChange.bind(this);
  }
  handleChange(event) {
    this.setState({
      [event.name]: event.target.value,
    })
      .then((result) => {
        console.log(result);
      })
      .catch((err) => {});
  }
  render() {
    return (
      <div>
        <form>
          <select onChange={this.handleChange}>
            <option name="company" selected value="null">
              택배사 정보
            </option>
            <option name="company" value="cj">
              CJ대한통운
            </option>
            <option name="company" value="hj">
              한진택배
            </option>
            <option name="company" value="kd">
              경동택배
            </option>
          </select>
          <input type="text" />
          <button className="button">확 인</button>
        </form>
      </div>
    );
  }
}
export default Home;
